    data: |
      SELECT DISTINCT + + ( - - col2 ) * - + col1, - 61 / - + ( + ( + col1 ) ) AS col0 FROM tab0 (FORMAT parquet) AS cor0;
  - name: tab0

outputs:
  - name: q9814.out
    data: |
      -210	2
      -3807	0
      -99	61
